using System;
using System.Collections.Generic;
using System.Data.Entity;
using System.Linq;
using System.Web;

namespace ImagesConverter.Models
{
    public class ImageFilesDbInitializer : DropCreateDatabaseAlways<StandardApiDbContext>
    {
        protected override void Seed(StandardApiDbContext dbContext)
        {
            dbContext.ImageFiles.Add(new ImageFile { Id = 1, DateConverted = DateTime.Now, ImageName = "Cat.png", MimeType = "png", Title = "Cat kit", ImageBase64 = "" });

            base.Seed(dbContext);
        }
    }
}